import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={ <Home /> } />
        <Route path="/list" element={ <Write />}/>
        <Route path="*" element={ <Page404 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
